import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import { Facebook, Twitter } from "react-feather";

function Navbar(props) {
  let { login, sign } = props;

  return (
    <div className="navbar-container">
      <div className="navbar-left-items"></div>
      <div className="navbar-logo">
        <Link className="link-item" to="/">
          <img className="logo-img" src="./images/logo-img.png" />
        </Link>
      </div>
      <div className="navbar-right-items">
        <div className="navbar-buttons">
          {login && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/login">
                Login
              </Link>
            </div>
          )}
          {sign && (
            <div className="navbar-btn  btn-navbar-sign">
              <Link className="link-item" to="/sign">
                Sign In
              </Link>
            </div>
          )}
          <Facebook />
          <Twitter />
        </div>
      </div>
    </div>
  );
}

export default Navbar;
